  [],\n\t\"revision_timestamp\": \"2015-09-27T00:46:30.579766\",\n\t\"name\": \"2006-texas-water-development-board-twdb-lidar-northern-cameron-and-willacy-counties\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Using a LH Systems ALS50 Light Detection
  And Ranging (LiDAR) system, standard density (1.4 meter ground sample distance)
  data were collected over areas in Northern Cameron and Willacy Counties, TX (approximately
  1021 square miles). Multiple returns were recorded for each laser pulse along with
  an intensity value for each return. The data are bare earth classified. The data
  acquisition occurred in 36 missions between December 14, 2005 and February 23, 2006.
  The data was collected by Sanborn Mapping Company, Inc. for the Texas Water Development
  Board (TWDB) and the Federal Emergency Management Agency (FEMA). Data arrived at
  NOAA OCM (formerly CSC) with a number of tiles without classified ground points.
  This caused issues in the automated delivery of data through the Digital Coast.
  As a result, users would request ground points (because the data parameters included
  ground) in areas without this classification. This caused data errors. In order
  to improve the data use and eradicate errors in automation, a software known as
  lasground was used to classify unclassified points to ground. The new files were
  replaced on the internal servers and on the ftp server.\",\n\t\"license_title\":
